import React from 'react';
import Header from '../components/Header';

const Services = () => {
    return (
        <div>
            <Header />
            <div style={{ padding: '4rem 2rem', textAlign: 'center' }}>
                <h1>Our Services</h1>
                <p>Services page coming soon...</p>
            </div>
        </div>
    );
};

export default Services;
